// ColorList.js
import React from 'react';
import { Link } from 'react-router-dom';

const ColorList = ({ colors }) => {
  return (
    <div>
      <h1>Colors</h1>
      <button><NavLink to="/colors/new" />Add New</button>
      <ul>
        {colors.map(color => (
          <li key={color.id}>
            <Link to={`/colors/${color.name}`}>
              {color.name} - {color.hex}
            </Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ColorList;
